import React from 'react';

import { Container } from './styles';

function Card({ data }) {
    return (
        <>
            <Container>
                <p> 1 </p>
                <span><img src="https://api.adorable.io/avatars/285/abott@adorable.png" alt="User Avatar"/> {data} </span>
                <span>Points: 10</span>
            </Container>
        </>
    )
}

export default Card;
